import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible
    await page.waitForSelector('#searchInput', { state: 'visible' });

    // Focus and type a search term that triggers autocomplete
    await page.click('#searchInput');
    await page.type('#searchInput', 'iph', { delay: 100 });

    // Wait for the suggestions dropdown to appear
    await page.waitForSelector('.search-suggestions', { state: 'visible', timeout: 2000 });

    // Take screenshot of suggestions
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_suggestions.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_suggestions.png'));

    // Extract suggestion texts
    const suggestionItems = await page.$$eval('.search-suggestions .suggestion-item', nodes =>
      nodes.map(n => n.textContent.trim())
    );

    // Click the first suggestion if available
    let clickedSuggestion = null;
    if (suggestionItems.length > 0) {
      clickedSuggestion = suggestionItems[0];
      await page.click(`.search-suggestions .suggestion-item:nth-child(1)`);
    }

    // Wait for suggestions to disappear
    await page.waitForSelector('.search-suggestions', { state: 'hidden', timeout: 2000 });

    // Take screenshot after suggestion selection
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_select.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_select.png'));

    // Wait for search results to load (simulate search button click if needed)
    // The script auto-performs search on suggestion click, but let's ensure results
    await page.waitForSelector('.search-results, .no-results', { timeout: 4000 });

    // Take screenshot of search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_results.png'));

    // Extract search result titles
    const resultTitles = await page.$$eval('.products-grid .product-title, .products-list .product-title', nodes =>
      nodes.map(n => n.textContent.trim())
    );

    // Extract the search input value after suggestion selection
    const searchInputValue = await page.$eval('#searchInput', el => el.value);

    return {
      success: true,
      action: "Tested search autocomplete: typed query, verified suggestions, selected suggestion, and verified search results.",
      extractedData: {
        suggestions: suggestionItems,
        clickedSuggestion,
        searchInputValue,
        resultTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
